import React, { Component } from 'react';

class App extends Component {
  state = {
    todos: [
      { id: 1, content: 'go to market' },
      { id: 2, content: 'close the pump' },
    ]
  };

  render() {
    return (
      <div className="App"></div>
    )
  }
}

export default App;
